import React from 'react';
import CardInfo from './components/CardInfo'

function Card(props) {
    return (
        <div>
            <img src = {props.item.imgSrc}/> 
            {props.item.selected && <CardInfo title = {props.item.title} subTitle = {props.items.subTitle}/>}
        </div>
    )
}

export default Card;
